document.addEventListener("DOMContentLoaded",(function(e){const r=document.querySelector(".darkmode-enabler");if(r){r.querySelector("input[type=checkbox]").addEventListener("change",(e=>{e.target.checked?document.querySelector("body").classList.add("darkmode-pls"):document.querySelector("body").classList.remove("darkmode-pls")}))}})),window.addEventListener("load",(()=>{if("serviceWorker"in navigator)try{navigator.serviceWorker.register("./serviceWorker.js"),console.log("Service Worker Registered")}catch(e){console.log("Service Worker Registration Failed")}}));